    [],nt"revision_timestamp": "2015-09-27T01:14:37.016549",nt"name": "biological-chemical-and-other-data-collected-aboard-the-thomas-g-thompson-during-cruise-tn267-i",nt"isopen":
    false,nt"url": null,nt"notes": "NODC accession 0104366 includes biological,
    chemical, optical, physical and underway data collected aboard the THOMAS G. THOMPSON
    during cruise TN267 in the Coastal Waters of SE Alaska and North Pacific Ocean from
    2011-07-29 to 2011-08-09. These data include Attenuation/Transmission, CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    DEPTH - BOTTOM, DEPTH - OBSERVATION, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC
    PRESSURE, SALINITY and WATER TEMPERATURE. The instruments used to collect these
    data include ADCP, CTD, GPS, echo sounder, fluorometer, oxygen meter and transmissometer.
    These data were collected by James Mercer of University of Washington; Applied Physics
    Laboratory, and by University of Washington as part of Recovery of the ATOC Pioneer
    Sea Mount Acoustic Source. The Lamont-Doherty Earth Observatory (LDEO) submitted
    these data to NODC as part of the NSF sponsored Rolling Deck to Repository (R2R)
    program. The CTD data submitted by the originator represent the raw data suite.
    Processed versions of the data were generated by NODC. The ADCP data represent the
    raw and automated processed data set. Post processed quality assessed data are not
    available in this accession.",nt"license_title": null,nt"extras": [{ntt"key":
